import React from 'react';

const About: React.FC = () => {
    return (
        <section id="about" style={{
            background: "#f9f9f9",
            borderRadius: "8px",
            boxShadow: "0 2px 8px rgba(0,0,0,0.07)",
            padding: "32px",
            margin: "24px auto",
            maxWidth: "700px"
        }}>
            <h2 style={{
                color: "#333",
                fontSize: "2rem",
                marginBottom: "16px",
                textAlign: "center"
            }}>About Me</h2>
            <p style={{
                color: "#444",
                fontSize: "1.1rem",
                lineHeight: "1.7",
                textAlign: "center"
            }}>
                I am Mohith, a passionate software engineer with expertise in web development, React, and modern JavaScript frameworks. I graduated from SIT, ISE, and have experience building scalable applications and working in collaborative teams.
            </p>
        </section>
    );
};

export default About;
